import * as VueRouter from 'vue-router'
import {createWebHistory} from "vue-router";

export const router = VueRouter.createRouter({
    mode: 'history',
    history: createWebHistory(),
    routes: [
        {
          path: '/home',
          alias: '/home',
          name: 'home',
          components: () => import('./components/CustomerList')
        },
        {
            path: '/customers/',
            alias: '/customers',
            name: 'customers',
            component: () => import('./components/CustomerList')
        },
        {
            path: '/customers/:id',
            name: 'edit-customer',
            component: () => import('./components/EditCustomer')
        },
        {
            path: '/customers/add',
            name: 'add-customer',
            component: () => import('./components/AddCustomer')
        },
        {
            path:'/products/',
            alias: '/products',
            name: 'products',
            component: () => import('./components/ProductList')
        },
        {
            path: '/products/:id',
            name: 'edit-product',
            component: () => import('./components/EditProduct')
        },
        {
            path: '/products/add',
            name: 'add-product',
            component: () => import('./components/AddProduct')
        }
    ]
})
